    /** Hàm cập nhật sản phẩm
     *
     * @param field         // trường cập nhật
     * @param object        // vd: { name: 'San Pham 123'}
     */
    updateProductForm(field, object) {
        if (this.ProductForm.valid) {
            if (!this.ProductForm.value.manysize) {
                if (field == 'warning_number')
                    object.warning_number = parseFloat(object.warning_number);
                if (field == 'price')
                    object.price = parseFloat(this.price.getRawValue());
                if (field == 'price_import')
                    object.price_import = parseFloat(this.price_import.getRawValue());
                if (field == 'price2')
                    object.price2 = this.management_product_price2 ? parseFloat(this.price2.getRawValue()) : 0;
                let data = {};
                data['units'] = [
                    ...this.ProductForm.value.units
                ];
                data['units'][0].price_import = parseFloat(this.price_import.getRawValue());
                data['units'][0].price = parseFloat(this.price.getRawValue());
                data['units'][0].price2 = this.management_product_price2 ? parseFloat(this.price2.getRawValue()) : 0;
                data['units'][0].barcode = this.ProductForm.value.barcode.toString();
                data['units'][0].unit = this.ProductForm.value.unit;
                delete object.unit;
                delete object.price;
                delete object.price2;
                delete object.price_import;
                delete object.barcode;
                object = Object.assign(Object.assign({}, object), data);
            }
            this.dataUnits = object['units'];
            if (this.barcode)
                this.updateProductByField(object);
        }
    }
